import { Container, Row,Col} from 'react-bootstrap'
// import Glyphicon from 'react-bootstrap/lib/Glyphicon'
import React from 'react'


 //import Sidebar from 'react-bootstrap-sidebar';

class CourseDashboard extends React.Component{
    
    render(){
        return(
            // <Container fluid>
            //     <Row>
            //         <Col xs={2} id="sidebar-wrapper">
            //             <Sidebar/>
            //         </Col>
            //         <Col  xs={10} id="page-content-wrapper">
            //             this is a test
            //         </Col> 
            //     </Row>
            // </Container>

            <div className="row">
                <div className="col-3">
                    <div className="nav flex-column nav-pills" id="v-pills-tab" role="tablist" aria-orientation="vertical">
                        <a className="nav-link active" id="v-pills-home-tab" data-toggle="pill" href="#v-pills-home" role="tab" aria-controls="v-pills-home" aria-selected="true">Home</a>
                        <a className="nav-link" id="v-pills-profile-tab" data-toggle="pill" href="#v-pills-profile" role="tab" aria-controls="v-pills-profile" aria-selected="false">Profile</a>
                        <a className="nav-link" id="v-pills-messages-tab" data-toggle="pill" href="#v-pills-messages" role="tab" aria-controls="v-pills-messages" aria-selected="false">Messages</a>
                        <a className="nav-link" id="v-pills-settings-tab" data-toggle="pill" href="#v-pills-settings" role="tab" aria-controls="v-pills-settings" aria-selected="false">Settings</a>
                    </div>
                </div>
            <div className="col-9">
                <div className="tab-content" id="v-pills-tabContent">
                    <div className="tab-pane fade show active" id="v-pills-home" role="tabpanel" aria-labelledby="v-pills-home-tab">Abhsihek</div>
                    <div className="tab-pane fade" id="v-pills-profile" role="tabpanel" aria-labelledby="v-pills-profile-tab">Shobha</div>
                    <div className="tab-pane fade" id="v-pills-messages" role="tabpanel" aria-labelledby="v-pills-messages-tab">Mama</div>
                    <div className="tab-pane fade" id="v-pills-settings" role="tabpanel" aria-labelledby="v-pills-settings-tab">Papa</div>
                </div>
            </div>
          </div>
        )
    }
}

export default CourseDashboard;
